    <style>
        body {
            font-family: sans-serif;
            padding: 20px;
            margin: 0;
            display: flex;
            flex-direction: column;
            justify-content: center;
            align-items: center;
            height: 100vh;
            box-sizing: border-box;
        }

        h1 {
            font-size: 24px;
            margin-bottom: 10px;
            margin-top: 50px;
        }

        .code-container {
            position: relative;
            margin-top: 20px;
            width: 100%;
            max-width: 600px;
        }

        .copy-button {
            background-color: rgb(255, 7, 86);
            border: none;
            color: #ffffff;
            font-size: 14px;
            padding: 8px 12px;
            margin-top: 16px;
            border-radius: 4px;
            cursor: pointer;
            display: flex;
            align-items: center;
            gap: 8px;
            text-decoration: none;
            outline: none;
        }


        pre {
            background-color: #f0f0f0;
            border-radius: 4px;
            padding: 16px;
            font-family: monospace;
            font-size: 14px;
            white-space: pre-wrap;
            overflow-x: auto;
            position: relative;
        }
        #logo {
            max-width: 150px;
            margin-bottom: 10px;
        }
    </style>
</head>

<p style="margin: 0">FigNative bate Streamline Your Design-to-Code Workflow</p>
<div class="code-container">
    <textarea id="code-output" style="display:none;"></textarea>
    <button id="copy-button" class="copy-button" title="Copy to Clipboard">
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="#f0f0f0" width="24px" height="24px">
            <path d="M0 0h24v24H0z" fill="none"/>
            <path d="M16 1H4c-1.1 0-2 .9-2 2v14h2V3h12V1zm3 4H8c-1.1 0-1.99.9-1.99 2L6 21c0 1.1.89 2 1.99 2H19c1.1 0 2-.9 2-2V9c0-1.1-.9-2-2-2zm0 14H8V9h11v10z"/>
        </svg>
        Copy
    </button>


</div>

<script>
    const codeOutput = document.getElementById('code-output');
    const copyButton = document.getElementById('copy-button');

    // Create CodeMirror instance
    const codeMirror = CodeMirror.fromTextArea(codeOutput, {
        mode: 'javascript',
        lineNumbers: true,
        readOnly: true,
        lineWrapping: true,
        showCursorWhenSelecting: true,
        theme: 'dracula', // Use the Dracula theme
    });


    // Listen for messages from the plugin
    onmessage = (event) => {
        const message = event.data.pluginMessage;
        if (message && message.type === 'reactNativeCode') {
            codeMirror.setValue(message.data);
        }
    };

    // Update the copyButton click event listener to use CodeMirror's getValue method
    copyButton.addEventListener('click', () => {
        const textarea = document.createElement('textarea');
        textarea.value = codeMirror.getValue();
        document.body.appendChild(textarea);
        textarea.select();
        document.execCommand('copy');
        document.body.removeChild(textarea);
        alert('React Native code copied to clipboard');
    });





</script>
</body>
